    true,nt"url": null,nt"notes": "The State Energy Data System (SEDS) is compiled
    by the U.S. Energy Information Administration's (EIA); it is a comprehensive database
    of energy statistics by state (and includes totals for the entire US). SEDS includes
    estimates of energy production, consumption, prices, and expenditures broken down
    by energy source and sector. Annual estimates are available from 1960 u2013 2009
    for production and consumption estimates and from 1970 u2013 2009 for price and
    expenditure estimates. The multi-dimensional nature of this EIA dataset allows users
    to make comparisons across States, energy sources, sectors, and over time.rnrn<u>Related
